import {React} from 'react'
import './App.css';
import Header from "./Header"
import Sidebar from "./Sidebar"
import Feed from "./Feed"
import Widgets from "./Widgets"
import Login from "./Login"

function App() {
  const user = 'null';

  return (
    // Bem naming convention
    <div className="app">
      {!user ? <h1>Login</h1> : (
        <>
          <Header />

          <div className="app__body">
            <Sidebar/>
            <Feed />
            <Widgets />
          </div>
          ) 
        </>
  )}
    </div>
  );
}

export default App;
